import React, { useEffect, useState } from 'react';

const App = () => {
    const [num, setNum] = useState(0);
    const [nums, setNums] = useState(0);
    useEffect(() => {
        alert('hey');
    });

    // let incr = () => {
    //     setNum(num + 1);
    //     alert('hey');       
    // }

    return (
        // <button onClick={incr}> Click me {num} </button>
        <>
            <button onClick={
                () => {
                    setNum(num + 1);
                }}> Click me {num} </button>
            <br/>
            <button onClick={
                () => {
                    setNum(nums + 1);
                }}> Click me {nums} </button>
        </>
    );
}

export default App;
